import { Route, Switch } from 'react-router';
import './App.css';
import Header from './Header';
import Home from './Home';

function App() {
  return (
    <div className="App">
      <Header />
      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>
        <Route path='/enter-marks'>

        </Route>
      </Switch>
    </div>
  );
}

export default App;
